                },
                set(_Provider) {
                    context.Provider = _Provider;
                }
            },
            _currentValue: {
                get() {
                    return context._currentValue;
                },
                set(_currentValue) {
                    context._currentValue = _currentValue;
                }
            },
            _currentValue2: {
                get() {
                    return context._currentValue2;
                },
                set(_currentValue2) {
                    context._currentValue2 = _currentValue2;
                }
            },
            Consumer: {
